import React from "react";
import "../styles/WorkProcess.css";
import Step1Icon from "../assets/step-1.svg";
import Step2Icon from "../assets/step-2.svg";
import Step3Icon from "../assets/step-3.svg";

const WorkProcess = () => {
  return (
    <section className="work-process-section">
      <p className="work-process-subtitle">WORK PROCESS</p>
      <h2 className="work-process-title">How it works?</h2>
      <div className="work-process-container">
        <div className="work-process-card">
          <img src={Step1Icon} alt="Step 1" />
          <h3>Escolha o melhor profissional para si</h3>
        </div>
        <span className="work-process-arrow">→</span>
        <div className="work-process-card">
          <img src={Step2Icon} alt="Step 2" />
          <h3>Escolha os horários que mais lhe convêm</h3>
        </div>
        <span className="work-process-arrow">→</span>
        <div className="work-process-card">
          <img src={Step3Icon} alt="Step 3" />
          <h3>Contacte o terapeuta para alguma informação adicional</h3>
        </div>
      </div>
    </section>
  );
};

export default WorkProcess;
